import { Fragment } from "react";

function Header() {
  return (
    <Fragment>
      <div id="skip-link">
        <a href="#main-content" class="element-invisible element-focusable">
          Pasar al contenido principal
        </a>
      </div>
    </Fragment>
  );
}
export default Header;
